I love our Valentine’s Day table.
Setting the table for special occasions has been something I have done since I was very young.
My mother would let me loose in the dining room and I could use all the very special linens, silver, candles and china. She totally trusted me to be careful. And I would close the door so it would be a surprise. She was always delighted with the results ( or so she made me believe 😀) 
We chose to stay home for Valentine’s Day so we could enjoy our own space with just each other!
Almost everything on the table is also in our @starbrightfarm barn market.
